import React, { useState } from 'react';
import axios from 'axios';

const Manage = () => {
  const [selectedOption, setSelectedOption] = useState('');
  const [action, setAction] = useState('');
  const [formData, setFormData] = useState({});

  const handleOptionChange = (e) => {
    setSelectedOption(e.target.value);
    setAction('');
    setFormData({});
  };

  const handleActionChange = (e) => {
    setAction(e.target.value);
    setFormData({});
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    const { name, files } = e.target;
    setFormData({ ...formData, [name]: files[0] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const form = new FormData();
    for (const key in formData) {
      form.append(key, formData[key]);
    }

    try {
      const response = await axios.post(`/${selectedOption}/${action}`, form, {
        headers: { 'Content-Type': 'multipart/form-data' }
      });
      console.log(response.data);
    } catch (error) {
      console.error('There was an error!', error);
    }
  };

  return (
    <div>
      <h1>Manage</h1>
      <div>
        <label>
          Select Option:
          <select value={selectedOption} onChange={handleOptionChange}>
            <option value="">--Select--</option>
            <option value="images">Images</option>
            <option value="syllabus">Syllabus</option>
            <option value="result">Result</option>
            <option value="exam">Exam</option>
          </select>
        </label>
      </div>

      {selectedOption && (
        <div>
          <label>
            Select Action:
            <select value={action} onChange={handleActionChange}>
              <option value="">--Select--</option>
              <option value="insert">Insert</option>
              <option value="update">Update</option>
              <option value="delete">Delete</option>
            </select>
          </label>
        </div>
      )}

      {action && (
        <form onSubmit={handleSubmit}>
          {selectedOption === 'images' && (
            <>
              <label>
                Upload Image:
                <input type="file" name="image" onChange={handleFileChange} />
              </label>
            </>
          )}

          {selectedOption === 'syllabus' && (
            <>
              <label>
                Subcode:
                <input type="text" name="subcode" onChange={handleInputChange} />
              </label>
              <label>
                Semester:
                <input type="text" name="sem" onChange={handleInputChange} />
              </label>
              <label>
                Name:
                <input type="text" name="name" onChange={handleInputChange} />
              </label>
              <label>
                Credit:
                <input type="text" name="credit" onChange={handleInputChange} />
              </label>
              <label>
                Syllabus File:
                <input type="file" name="syllabusFile" onChange={handleFileChange} />
              </label>
            </>
          )}

          {selectedOption === 'result' && (
            <>
              <label>
                Semester:
                <input type="text" name="sem" onChange={handleInputChange} />
              </label>
              <label>
                Result File:
                <input type="file" name="resultFile" onChange={handleFileChange} />
              </label>
            </>
          )}

          {selectedOption === 'exam' && (
            <>
              <label>
                Exam Type:
                <input type="text" name="examtype" onChange={handleInputChange} />
              </label>
              <label>
                Year:
                <input type="text" name="year" onChange={handleInputChange} />
              </label>
              <label>
                Semester:
                <input type="text" name="sem" onChange={handleInputChange} />
              </label>
              <label>
                Class:
                <input type="text" name="class" onChange={handleInputChange} />
              </label>
              <label>
                Schedule:
                <input type="text" name="schedule" onChange={handleInputChange} />
              </label>
              <label>
                Seating Arrangement:
                <input type="text" name="seatingArrangement" onChange={handleInputChange} />
              </label>
            </>
          )}

          <button type="submit">Submit</button>
        </form>
      )}
    </div>
  );
};

export default Manage;
